  // Overrides the genId method to ensure that a articulo always has an id.
  // If the articulos array is empty,
  // the method below returns the initial number (1).
  // if the players array is not empty, the method below returns the highest
  // player id + 1.
  genId(articulos: Articulo[]): number {
    return articulos.length > 0 ? Math.max(...articulos.map(articulo => articulo.id)) + 1 : 11;
  }
